How It's Made: Collection 3

Technology Documentary hosted by Tony Hirst, published by Discovery Channel in 2012 - English narration


Information
------------------------------

How It's Made: Collection 3
Each day we use hundreds of products throughout our routines, never stopping to think about where those products come from and how they were manufactured. How It's Made shows you the outrageous behind the ordinary in the step-by-step processes of building, crafting and creating our most common products.


1)  Part 1 
Farmed Caviar, Intake Manifolds, Motorcycle Jackets, Shovels &amp; Spades
Pewter Flasks, Potato Salad, Hydrogen Fuel Cells, Engineered Wood Siding.
Bamboo Bicycles; Chainsaw Art; Breath Mints; Manual Motorcycle Transmissions
Fish Decoys; Film Digitization; Cylinder Stoves; Concrete Light Poles
Tapioca Pudding, Snow Ploughs, Paddle Boats, Fibre Cement Siding.
Garden Forks; English Toffee; Paint Chip Cards; Bundt Pans

2)  Part 2 
Dinnerware; Air Brake Tanks; Frosted Cereal; Fossils
Blister Packs, Deli Slicers, Oysters, Weathervanes
Clay; Pitted Prunes; Spurs; Polyurethane Tires.
Robotic Hunting Decoys, Canned Tomatoes, Scoreboards, Lassos.
Chocolate Coins, Floor Heating Systems, Pedal Cars, Latex Swords.
Cufflinks, Blueberry Turnovers, Dashboards, Pottery

3)  Part 3 
Pressure Cookers, Mechanical Singing Birds, Oceanographic Buoys
Fibreglass insulation, wooden ducks, gumball machines and exhaust systems
Aluminium Boats, Alpine Horns and Luxury Watches
Chains/Bagels/Vinyl Records
All-Terrain Vehicles, Alpine Skis, Laser Cutters and Marble Sculptures
Socket Sets, Leather Shoes, Aluminium Water Bottles and Bike Chains

